import Menu from "../Menu";
import { Container, Conteudo } from "../../styles/global";

export default function AlterarFuncionario() {
  let idFuncionario = localStorage.getItem('idFuncionario');
  return (
    <Container>
      <Menu></Menu>
      <Conteudo>
        funcionario selecionado: {localStorage.getItem('idFuncionario')}
        operacao: {localStorage.getItem('operacao')}
      </Conteudo>
    </Container>
  );
}
